import styled from 'styled-components';
import Link from 'next/link';

import { FiRadio, FiHeadphones, FiHeart } from 'react-icons/fi';
import ListItem from './styles/LinkStyles';

const primary = '#309F5E';
const BottomSideBar = () => (
  <Wrapper>
    <Heading>For You</Heading>
    <ListItem>
      <FiRadio color={primary} />
      <Link href="/new">
        New
        <a />
      </Link>
    </ListItem>
    <ListItem>
      <FiHeart color={primary} />
      <Link href="/likes">
        Likes
        <a />
      </Link>
    </ListItem>
    <ListItem>
      <FiHeadphones color={primary} />
      <Link href="/playlist">
        Playlist
        <a />
      </Link>
    </ListItem>
  </Wrapper>
);
const Wrapper = styled.div``;
const Heading = styled.Heading`
  font-size: 24px;
`;
export default BottomSideBar;
